import '../style.scss'



const Sayo = () => {
    return(
        <div className='Sayo'>
            <div>반응형</div>
            <div>모바일, 태블릿, PC 화면에서 호환될 수 있도록 반응형으로 구현했습니다.</div>
        </div>
    )
}

export default Sayo;
